script: |
  super -f text -I q8130.spq | sort > q8130.out

inputs:
  - name: q8130.spq
    data: |
      SELECT DISTINCT + - col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 * ( + - col2 ) / col1 + - ( + col0 ) + - 89 IS NOT NULL;
  - name: tab2

outputs:
  - name: q8130.out
    data: |
      -23
      -40
      -58
